import React from "react";
import {FontAwesomeIcon } from "@fortawesome/react-fontawesome"
{/* import {fa-plus-square} from '@fortawesome/free-solid-svg-icons' */}
import {BsFillPlusSquareFill} from '@fortawesome/free-solid-svg-icons'

function SearchBar(){
    function addTodo(){
        return null;
    }

    return(
        <section id="searchbar">
            <input type="text" className=" rounded w-1/4 shadow-md "/>
            <button onClick={addTodo} className="rounded "><i className="fas fa-plus-square bg-red-800 "/></button>


        </section>
)


}



export default SearchBar;
